import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  flex-direction: column;

  .single-tile {
    display: flex;
    flex-direction: column;
    margin-bottom: 8px;

    span {
      color: black;
      font-size: 18px;
      text-align: left;
    }

    button {
      background: transparent;
      border: none;
    }
  }
`;
